import React from "react";
import "./App.css";
import Content from "./component/content/Content";
import Footer from "./component/Footer";
import Header from "./component/Header";


function App() {
  return (
      <div className="App">
        <Header />
        <Content />
        <Footer />
      </div>
  );
}

export default App;
